package timezonemapper

// LatLngToTimezoneString converts from GPS coordinate latitude/longitude
// to timezone string, for example: "Asia/Shanghai".
// Invalid or unknown timezone will fall back to empty string "".
// In that case, if you get location by time.LoadLocation(timezone), 
// an UTC location will be returned.
func LatLngToTimezoneString(lat, lng float64) string {
	if lat < -90 || lat > 90 || lng < -180 || lng > 180 {
		return timezoneStrings[0]
	}
	tzId := timezoneStrings[getTzInt(lat, lng)]
	return tzId
}

