type tzPolygon struct {
	pts []float64
}

func (t *tzPolygon) Contains(testY, testX float64) (inside bool) {
	inside = false
	n := len(t.pts)
	yj := t.pts[n-2]
	xj := t.pts[n-1]
	for i := 0; i < n; {
		yi := t.pts[i]
		i += 1
		xi := t.pts[i]
		i += 1

		if ((yi > testY) != (yj > testY)) && (testX < (xj-xi)*(testY-yi)/(yj-yi)+xi-0.0001) {
			inside = !inside
		}
		xj = xi
		yj = yi
	}
	return
}

func createtzPolygon(f ...float64) tzPolygon {
	return tzPolygon{pts: f}
}

